        <Container>
            <div style={{borderColor: '#E6E5EA'}} className="w-2/6 inline-block border-r h-full">

            </div>
            <div className="w-4/6 inline-block bg-gray-800 h-full">

            </div>
        </Container>
    );
}

export default App;
